insert  into `bbgshop_distribution_rate`(`id`,`rate`,`ownrate`,`secondrate`,`price`,`rules_text`) values (1,'10.00','2.23','12.00','0.00','<p>小伙伴，欢迎加入我们</p><p>我们是贝堡全球购的运营团队，竭诚为你的销售工作提供完善的支持。</p><p>我们诚挚邀请你加入我们的销售员推广计划，无任何成本即可成为贝堡全球购的销售 员，一起分享收获的喜悦。你只需将高品质商品分享推荐给他人，收获他人的感谢的同时，挣得属于自己的利润。</p><h2>1. 业绩说明</h2><p>1）买家通过销售员分享链接成交，即算作销售员的业绩；</p><p>2）订单交易完成前发生退款的订单，相应的销售员业绩将扣除相应的退款金额；</p><p>3）仅在线支付的订单算作业绩，不包括货到付款订单。</p><h2>2. 结算说明</h2><p>1）推广商品，获得8%的业绩提成；</p><p>2）另外，邀请他人成为分销员，您可以终身获得额外的2%邀请佣金分成；</p><h2>3. 其他说明</h2><p>1）分享前，请确定商品页面有 分享 按钮 （只有在商品详情页分享才有效）；</p><p>2）销售过程中有任何疑问，请直接在微信公众号内询问或直接致电；</p><p>3）已售出商品的任何售后问题，由本商城处理；</p><p>4）不传播或者扩散有关于政治、色情等任何违法的信息，一经发现，直接踢你出局，如果触犯任何法律相关问题，商城不负任何责任；</p><p>5）以上内容解释权归本商城所有。</p><p><br></p><h2>4. 联系方式</h2><p>1）联络人：缪经理</p><p>2）手机：0519-89888898</p><p><br></p><p>无论是销售、对账，还是结算问题，请通过以上方式咨询。</p>');

