/*Table structure for table `bbgshop_goods_issue` */

DROP TABLE IF EXISTS `bbgshop_goods_issue`;

CREATE TABLE `bbgshop_goods_issue` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` bigint(32) DEFAULT NULL,
  `question` varchar(255) DEFAULT NULL,
  `answer` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4;

/*Data for the table `bbgshop_goods_issue` */

insert  into `bbgshop_goods_issue`(`id`,`goods_id`,`question`,`answer`) values (1,0,'购买运费如何收取？','在小程序上下单没有运费！！哼，不是老板说的，是程序员说的。'),(2,0,'使用什么快递发货？','默认使用顺丰快递发货（个别商品使用其他快递），配送范围覆盖全国大部分地区（港澳台地区除外巴拉巴拉小巴拉）'),(3,0,'如何申请退货？','暂时没有退货入口，请确认后下单。两个礼拜就想让我做一个完完整整的项目，哼，我又不是神。'),(4,0,'如何开具发票？','如果要开发票的，请联系贝堡网络科技有限公司——开发票办事处。');

/*Table structure for table `bbgshop_goods_specification` */

DROP TABLE IF EXISTS `bbgshop_goods_specification`;

CREATE TABLE `bbgshop_goods_specification` (
  `id` int(32) unsigned NOT NULL AUTO_INCREMENT,
  `goods_id` bigint(32) unsigned NOT NULL DEFAULT '0',
  `specification_id` int(11) unsigned NOT NULL DEFAULT '0',
  `value` varchar(50) NOT NULL DEFAULT '',
  `pic_url` varchar(255) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `specification_id` (`specification_id`)
